import { TableRow } from "./TableRow"

export const ListOfEntries = ({ tableTitles, advisorsArray, searchQuery }) => {
    return (
        <section id="list-of-entries">
            <table>
                <thead>
                    <tr>
                        {tableTitles.map(function (columnTitle) {
                            return (
                                <th key={columnTitle.id}>{columnTitle.title}</th>
                            )
                        })}
                    </tr>
                </thead>
                <tbody>



                    {/* {advisorsArray.map(function (advisor) {
                        return (
                            <TableRow key={advisor.id} entry={advisor} />
                        )
                    })} */}


                    {advisorsArray.filter(advisor => advisor.Woonplaats.includes(searchQuery)).map(filteredPerson => (
                        <li>
                            {filteredPerson.Bedrijfsnaam}
                        </li>
                    ))}
                </tbody>
            </table >

        </section>
    )
}
